      SELECT ALL col0 + col1 FROM tab2 (FORMAT parquet) cor0 WHERE 83 BETWEEN ( - - col2 / + - col0 - + 12 - + + 63 * col0 * - col2 ) AND col0 * col1;
  - name: tab2

outputs:
  - name: q3991.out
    data: |
